import React, { useContext } from 'react';
import StoreContext from '../components/Store/Context';
import './Home.css';

const Home = ({userData}) => {
  const { setToken } = useContext(StoreContext);

  return (
    <div className="pages-home">
      <br/>
      <button type="button" onClick={() => setToken(null)}>
        Sair
      </button>
    </div>
  );
};

export default Home;
